 <MDBCardBody className='p-5'>

   <MDBRow>
     <MDBCol col='6'>
       <MDBInput wrapperClass='mb-4' label='First name' id='form1' type='text' value={signUpData.fName} onChange={(e)=>{setsignUpDAta({...setsignUpDAta,fName:e.target.value })}}/>
       
     </MDBCol>

     <MDBCol col='6'>
       <MDBInput wrapperClass='mb-4' label='Last name' id='form2' type='text'onChange={(e)=>{setsignUpDAta({...setsignUpDAta,lName:e.target.value })}}/>
     </MDBCol>
   </MDBRow>

   <MDBInput wrapperClass='mb-4' label='Email' id='form3' type='email'onChange={(e)=>{setsignUpDAta({...setsignUpDAta,email:e.target.value })}}/>
   <MDBInput wrapperClass='mb-4' label='Password' id='form4' type='password'onChange={(e)=>{setsignUpDAta({...setsignUpDAta,password:e.target.value })}}/>
   <MDBInput wrapperClass='mb-4' label='confirm Password' id='form5' type='password'onChange={(e)=>{setsignUpDAta({...setsignUpDAta,confirmPasswordpassword:e.target.value })}}/>

